import Swipe from './index.vue';
import SwipeItem from './SwipeItem.vue';
Swipe.install = (Vue) => {
    Vue.component(Swipe.name, Swipe);
};
SwipeItem.install = (Vue) => {
    Vue.component(SwipeItem.name, SwipeItem);
};
export {
    Swipe,
    SwipeItem,
};
export default {
    install(Vue) {
        Swipe.install(Vue);
        SwipeItem.install(Vue);
    },
    Swipe,
    SwipeItem,
};
